import React, { Component } from 'react';

class Greeting extends Component {
    render() {
        let closingMsg = 'Enjoy your day!';
        if (this.props.temp < 60) {
            closingMsg = 'Brr!';
        }
        return <h1>Hello {this.props.name}!</h1>;
    }
}

export default Greeting;
